import { CardWrapper, Card, InnerCard, ImageThumbnail } from '../styled-components/CardElements'
import Logo from '../Logo';

const CardList = ({ cards }) => {
  return (
      <CardWrapper>
        {cards.map((card) => (
            <Card key={card.petCard._id}>
              <InnerCard>
                <ImageThumbnail>
                  <Logo />
                </ImageThumbnail>
                { card.petCard.status }
                { card.petCard.petName }
                { card.petCard.breed }
                { card.petCard.species }
                { card.petCard.location }
              </InnerCard>
            </Card>
        ))}     
      </CardWrapper> 
  )
}

export default CardList;
